import React from 'react';

const FieldsViewer=({label, handleChange, type="text"})=>{
    var value;
    if(type=="color")
    {
        value="#000000";
    }
    return(
        <div>
           <label>{label}:</label>
           <input
           value={value}
                required
                type={type}
                onChange={handleChange}
                >          
           </input>
        </div>
    );
        
    

}

export default FieldsViewer;
